import './App.css';
import React from 'react';
import {StyleSheet, View} from 'react-native';

const Flex = () => {
  return (
    <View style={[
        styles.container,
        {backgroundColor: 'red'}
      ]}>
        text
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  }
});

export default Flex;
